import React, { useState, useEffect } from 'react';

const VisitModal = ({ show, onClose, onSave, visitItem }) => {
  const [formData, setFormData] = useState({
    date: '',
    reason: '',
    diagnosis: '',
    treatment: '',
    notes: '',
  });

  const [errors, setErrors] = useState({});

  useEffect(() => {
    if (visitItem) {
      setFormData({
        date: visitItem.date ? visitItem.date.substring(0, 10) : '',
        reason: visitItem.reason || '',
        diagnosis: visitItem.diagnosis || '',
        treatment: visitItem.treatment || '',
        notes: visitItem.notes || '',
      });
    } else {
      setFormData({
        date: '',
        reason: '',
        diagnosis: '',
        treatment: '',
        notes: '',
      });
    }
    setErrors({});
  }, [visitItem, show]);

  if (!show) return null;

  const validate = () => {
    const newErrors = {};
    if (!formData.date) newErrors.date = 'Visit date is required';
    if (!formData.reason.trim()) newErrors.reason = 'Reason for visit is required';
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData(prev => ({ ...prev, [id]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!validate()) return;
    onSave(formData);
  };

  return (
    <div
      className="modal d-block"
      tabIndex="-1"
      style={{ backgroundColor: 'rgba(0,0,0,0.5)' }}
      onClick={onClose}
    >
      <div className="modal-dialog" role="document" onClick={(e) => e.stopPropagation()}>
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">{visitItem ? 'Edit Visit' : 'Add Visit'}</h5>
            <button type="button" className="btn-close" aria-label="Close" onClick={onClose} />
          </div>
          <form onSubmit={handleSubmit} noValidate>
            <div className="modal-body">
              <div className="mb-3">
                <label htmlFor="date" className="form-label">
                  Visit Date<span style={{ color: 'red' }}>*</span>
                </label>
                <input
                  type="date"
                  id="date"
                  className={`form-control ${errors.date ? 'is-invalid' : ''}`}
                  value={formData.date}
                  onChange={handleChange}
                  required
                />
                {errors.date && <div className="invalid-feedback">{errors.date}</div>}
              </div>
              <div className="mb-3">
                <label htmlFor="reason" className="form-label">
                  Reason for Visit<span style={{ color: 'red' }}>*</span>
                </label>
                <input
                  type="text"
                  id="reason"
                  className={`form-control ${errors.reason ? 'is-invalid' : ''}`}
                  value={formData.reason}
                  onChange={handleChange}
                  required
                />
                {errors.reason && <div className="invalid-feedback">{errors.reason}</div>}
              </div>
              <div className="mb-3">
                <label htmlFor="diagnosis" className="form-label">Diagnosis</label>
                <input
                  type="text"
                  id="diagnosis"
                  className="form-control"
                  value={formData.diagnosis}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="treatment" className="form-label">Treatment</label>
                <textarea
                  id="treatment"
                  className="form-control"
                  rows="3"
                  value={formData.treatment}
                  onChange={handleChange}
                />
              </div>
              <div className="mb-3">
                <label htmlFor="notes" className="form-label">Notes</label>
                <textarea
                  id="notes"
                  className="form-control"
                  rows="3"
                  value={formData.notes}
                  onChange={handleChange}
                />
              </div>
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" onClick={onClose}>
                Cancel
              </button>
              <button type="submit" className="btn btn-primary">
                {visitItem ? 'Update' : 'Save'}
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default VisitModal;
